[{"location":"","page":"Home","title":"Home","text":"CurrentModule = AISCSteel","category":"page"},{"location":"#AISCSteel","page":"Home","title":"AISCSteel","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for AISCSteel.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [AISCSteel]","category":"page"},{"location":"#AISCSteel.classify_section_for_lb_case1-NTuple{4, Any}","page":"Home","title":"AISCSteel.classify_section_for_lb_case1","text":"classify_section_for_lb_case1(b, t, E, F_y)\n\nClassifies the section of a member subject to axial compression. \n\nDescription of applicable member: Flanges of rolled I-shaped sections, plates projecting from rolled I-shaped sections, outstanding legs of pairs of angles connected with continuous contact, flanges of channels, and flanges of tees. \n\nArguments\n\nb: width of the plate or half the width of the flange.\nt: thickness of the flange.\nE: elastic section modulous.\nF_y: yield strength of steel.\n\nReturns\n\nCompressionBucklingType enum whose value is either Nonslender or Slender\n\nReference\n\nAISC Table B4.1a\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.classify_section_for_lb_case10-NTuple{4, Any}","page":"Home","title":"AISCSteel.classify_section_for_lb_case10","text":"classify_section_for_lb_case10(b, t, E, F_y)\n\nClassifies the compressive elements of a member subject to flexural. \n\nDescription of applicable member: Flanges of rolled I-shaped sections, channels, and tees. \n\nArguments\n\nb: width of the plate or half the width of the flange.\nt: thickness of the flange.\nE: elastic section modulous.\nF_y: yield strength of steel.\n\nReturns\n\nFlexureBucklingType enum whose value is either Compact, Noncompact, or Slender\n\nReference\n\nAISC Table B4.1b\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.classify_section_for_lb_case13-NTuple{4, Any}","page":"Home","title":"AISCSteel.classify_section_for_lb_case13","text":"classify_section_for_lb_case13(b, t, E, F_y)\n\nClassifies the compressive elements of a member subject to flexural. \n\nDescription of applicable member: Flanges of all I-shaped sections and channels bent about their minor axis. \n\nArguments\n\nb: width of the plate or half the width of the flange.\nt: thickness of the flange.\nE: elastic section modulous.\nF_y: yield strength of steel.\n\nReturns\n\nFlexureBucklingType enum whose value is either Compact, Noncompact, or Slender\n\nReference\n\nAISC Table B4.1b\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.classify_section_for_lb_case15-NTuple{4, Any}","page":"Home","title":"AISCSteel.classify_section_for_lb_case15","text":"classify_section_for_lb_case15(b, t, E, F_y)\n\nClassifies the compressive elements of a member subject to flexural. \n\nDescription of applicable member: Webs of doubly-symmetric I-shaped sections and channels. \n\nArguments\n\nh: \nFor rolled sections: the clear distance between flanges less the fillet at each flange.\nFor built-up sections: clear distance between flanges when welds are used.\nt_w: thickness of the web.\nE: elastic section modulous.\nF_y: yield strength of steel.\n\nReturns\n\nFlexureBucklingType enum whose value is either Compact, Noncompact, or Slender\n\nReference\n\nAISC Table B4.1b\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f2","page":"Home","title":"AISCSteel.flexure_capacity_f2","text":"flexure_capacity_f2(E, F_y, Z_x, S_x, r_y, h_0, J, c, r_ts, L_b, C_b=1)\n\nCalculates the moment capacity of the applicable section.\n\nDescription of applicable member: Doubly symmetric compact I-shaped members and channels bent about their major axis. \n\nArguments\n\nE: modulous of elasticity (ksi)\nF_y: yield strength of steel (ksi)\nZ_x: plastic section modulous  (inch^4)\nS_x: elastic section modulous (inch^3)\nr_y: radius of gyration about the y-axis (inch)\nh_0: distance between the flange centroids (inch)\nJ: torsional constant (inch^4)\nc:\nr_ts:\nL_b: unbraced length (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_n: moment capacity of the section.\n\nReference\n\nAISC Section F2\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f2_1-Tuple{Any}","page":"Home","title":"AISCSteel.flexure_capacity_f2_1","text":"flexure_capacity_f2_1(M_p)\n\nCalculates the moment capacity of the applicable section for yielding.\n\nDescription of applicable member: Doubly symmetric compact I-shaped members and channels bent about their major axis. \n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\n\nReturns\n\nM_nFY: moment capacity of the section for yielding.\n\nReference\n\nAISC Section F2.1\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f2_2","page":"Home","title":"AISCSteel.flexure_capacity_f2_2","text":"flexure_capacity_f2_2(M_p, F_y, S_x, F_cr, L_b, L_p, L_r, C_b=1)\n\nCalculates the moment capacity of the applicable section for lateral torsional buckling.\n\nDescription of applicable member: Doubly symmetric compact I-shaped members and channels bent about their major axis. \n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nF_y: yield strength of steel (ksi)\nS_x: elastic section modulous (inch^3)\nF_cr: critical stress (ksi)\nL_b: unbraced length (inch)\nL_p: the limiting laterally unbraced length for the limit state of yielding (inch)\nL_r: the limiting laterally unbraced length for the limit state of inelastic lateral-torsional buckling (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_nLTB: moment capacity of the section for lateral torsional buckling.\n\nReference\n\nAISC Section F2.2\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f3","page":"Home","title":"AISCSteel.flexure_capacity_f3","text":"flexure_capacity_f3(E, F_y, Z_x, S_x, r_y, h_0, J, c, r_ts, L_b, h, t_w, λ_f, λ_pf, λ_rf, λ_fclass, C_b=1)\n\nCalculates the moment capacity of the applicable section.\n\nDescription of applicable member: Doubly symmetric I-shaped members with compact webs and noncompact or slender flanges bent about their major axis.\n\nArguments\n\nE: modulous of elasticity (ksi)\nF_y: yield strength of steel (ksi)\nZ_x: plastic section modulous  (inch^4)\nS_x: elastic section modulous (inch^3)\nr_y: radius of gyration about the y-axis (inch)\nh_0: distance between the flange centroids (inch)\nJ: torsional constant (inch^4)\nc:\nr_ts:\nL_b: unbraced length (inch)\nh: clear distance between flanges less the fillets (inch)\nt_w: thickness of the web (inch)\nλ_f: slenderness ratio of the flange\nλ_pf: compact slenderness ratio limit of the flange\nλ_rf: noncompact slenderness ratio limit of the flange\nλ_fclass: compact noncompact or slender classification for the flange\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_n: moment capacity of the section.\n\nReference\n\nAISC Section F3\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f3_1","page":"Home","title":"AISCSteel.flexure_capacity_f3_1","text":"flexure_capacity_f3_1(M_p, F_y, S_x, F_cr, L_b, L_p, L_r, C_b=1)\n\nCalculates the moment capacity of the applicable section for yielding.\n\nDescription of applicable member: Doubly symmetric I-shaped members with compact webs and noncompact or slender flanges bent about their major axis. \n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nF_y: yield strength of steel (ksi)\nS_x: elastic section modulous (inch^3)\nF_cr: critical stress (ksi)\nL_b: unbraced length (inch)\nL_p: the limiting laterally unbraced length for the limit state of yielding (inch)\nL_r: the limiting laterally unbraced length for the limit state of inelastic lateral-torsional buckling (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_nLTB: moment capacity of the section for lateral torsional buckling.\n\nReference\n\nAISC Section F3.1\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f3_2-NTuple{9, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f3_2","text":"flexure_capacity_f3_2(M_p, E, F_y, S_x, k_c, λ_f, λ_pf, λ_rf, λ_fclass)\n\nCalculates the moment capacity of the applicable section for compression flange local buckling.\n\nDescription of applicable member: Doubly symmetric I-shaped members with compact webs and noncompact or slender flanges bent about their major axis. \n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nE: modulous of elasticity (ksi)\nF_y: yield strength of steel (ksi)\nS_x: elastic section modulous (inch^3)\nk_c: \nλ_f: slenderness ratio of the flange\nλ_pf: compact slenderness ratio limit of the flange\nλ_rf: noncompact slenderness ratio limit of the flange\nλ_fclass: compact noncompact or slender classification for the flange\n\nReturns\n\nM_nCFLB: moment capacity of the section for compression flange local buckling.\n\nReference\n\nAISC Section F3.2\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f4-NTuple{24, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f4","text":"flexure_capacity_f4(E, F_y, Z_x, S_x, S_xc, S_xt, b_fc, t_fc, h, h_c, t_w, J, h_0, I_y, I_yc, λ_w, λ_pw, λ_rw, λ_f, λ_pf, λ_rf, λ_fclass, L_b, C_b=1)\n\nCalculates the moment capacity of the applicable section.\n\nDescription of applicable member: Other I-shaped members with compact webs or noncompact webs bent about their major axis.\n\nArguments\n\nE: modulous of elasticity (ksi)\nF_y: yield strength of steel (ksi)\nZ_x: plastic section modulous  (inch^4)\nS_x: elastic section modulous (inch^3)\nS_xc: elastic section modulous referred to compression flange (inch^3)\nS_xt: elastic section modulous referred to tension flange (inch^3)\nb_fc: width of compression flange (inch)\nt_fc: thickness of compression flange (inch)\nh: clear distance between flanges less the fillets (inch)\nh_c: twice the distance from the centroid to the following: (inch)\nthe inside face of the compression flange less the fillet or corner radius for rolled shapes\nthe nearest line of fasteners at the compression flange or inside face of the compression flange when welds are used for built-up sections\nt_w: thickness of the web (inch)\nJ: torsional constant (inch^4)\nh_0: distance between the flange centroids (inch)\nI_y: second moment of inertia about the y-axis (inch^4)\nI_yc: second moment of inertia about the y-axis for the compression flange (inch^4)\nλ_w: slenderness ratio of the flange\nλ_pw: compact slenderness ratio limit of the web\nλ_rw: noncompact slenderness ratio limit of the web\nλ_f: slenderness ratio of the flange\nλ_pf: compact slenderness ratio limit of the flange\nλ_rf: noncompact slenderness ratio limit of the flange\nλ_fclass: compact noncompact or slender classification for the flange\nL_b: unbraced length (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_n: moment capacity of the section.\n\nReference\n\nAISC Section F4\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f4_1-Tuple{Any, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f4_1","text":"flexure_capacity_f4_1(R_pc, M_yc)\n\nCalculates the moment capacity of the applicable section for compression flange yielding.\n\nDescription of applicable member: Other I-shaped members with compact webs or noncompact webs bent about their major axis.\n\nArguments\n\nR_pc: web plastification factor\nM_yc: yield moment in the compression flange \n\nReturns\n\nM_nCFY: moment capacity of the section for compression flange yielding.\n\nReference\n\nAISC Section F4.1\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f4_2","page":"Home","title":"AISCSteel.flexure_capacity_f4_2","text":"flexure_capacity_f4_2(M_p, R_pc, M_yc, F_L, S_xc, F_cr, L_b, L_p, L_r, C_b=1)\n\nCalculates the moment capacity of the applicable section for lateral torsional buckling.\n\nDescription of applicable member: Other I-shaped members with compact webs or noncompact webs bent about their major axis.\n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nR_pc: web plastification factor\nM_yc: yield moment in the compression flange \nF_L: nominal compression flange stress above which the inelastic buckling limit states apply (ksi)\nS_xc: elastic section modulous referred to compression flange (inch^3)\nF_cr: critical stress (ksi)\nL_b: unbraced length (inch)\nL_p: the limiting laterally unbraced length for the limit state of yielding (inch)\nL_r: the limiting laterally unbraced length for the limit state of inelastic lateral-torsional buckling (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_nLTB: moment capacity of the section for lateral torsional buckling.\n\nReference\n\nAISC Section F4.2\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f4_3-NTuple{11, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f4_3","text":"flexure_capacity_f4_3(M_p, R_pc, M_yc, F_L, S_xc, E, k_c, λ_f, λ_pf, λ_rf, λ_fclass)\n\nCalculates the moment capacity of the applicable section for compression flange local buckling.\n\nDescription of applicable member: Other I-shaped members with compact webs or noncompact webs bent about their major axis.\n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nR_pc: web plastification factor\nM_yc: yield moment in the compression flange \nF_L: nominal compression flange stress above which the inelastic buckling limit states apply (ksi)\nS_xc: elastic section modulous referred to compression flange (inch^3)\nE: modulous of elasticity (ksi)\nk_c: \nλ_f: slenderness ratio of the flange\nλ_pf: compact slenderness ratio limit of the flange\nλ_rf: noncompact slenderness ratio limit of the flange\nλ_fclass: compact noncompact or slender classification for the flange\n\nReturns\n\nM_nCFLB: moment capacity of the section for compression flange local buckling.\n\nReference\n\nAISC Section F4.3\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f4_4-NTuple{5, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f4_4","text":"flexure_capacity_f4_4(M_p, R_pt, M_yt, S_xc, S_xt)\n\nCalculates the moment capacity of the applicable section for tension flange yielding.\n\nDescription of applicable member: Other I-shaped members with compact webs or noncompact webs bent about their major axis.\n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\nR_pt: web plastification factor corresponding to the tension flange yielding limit state\nM_yt: yield moment in the tension flange \nS_xc: elastic section modulous referred to compression flange (inch^3)\nS_xt: elastic section modulous referred to tension flange (inch^3)\n\nReturns\n\nM_nTFY: moment capacity of the section for tension flange yielding.\n\nReference\n\nAISC Section F4.4\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f5","page":"Home","title":"AISCSteel.flexure_capacity_f5","text":"flexure_capacity_f5(E, F_y, S_xc, S_xt, b_fc, t_fc, h, h_c, t_w, λ_f, λ_pf, λ_rf, λ_fclass, L_b, C_b=1)\n\nCalculates the moment capacity of the applicable section.\n\nDescription of applicable member: I-shaped members with slender webs bent about their major axis.\n\nArguments\n\nE: modulous of elasticity (ksi)\nF_y: yield strength of steel (ksi)\nS_x: elastic section modulous (inch^3)\nS_xc: elastic section modulous referred to compression flange (inch^3)\nS_xt: elastic section modulous referred to tension flange (inch^3)\nb_fc: width of compression flange (inch)\nt_fc: thickness of compression flange (inch)\nh: clear distance between flanges less the fillets (inch)\nh_c: twice the distance from the centroid to the following: (inch)\nthe inside face of the compression flange less the fillet or corner radius for rolled shapes\nthe nearest line of fasteners at the compression flange or inside face of the compression flange when welds are used for built-up sections\nt_w: thickness of the web (inch)\nλ_f: slenderness ratio of the flange\nλ_pf: compact slenderness ratio limit of the flange\nλ_rf: noncompact slenderness ratio limit of the flange\nλ_fclass: compact noncompact or slender classification for the flange\nL_b: unbraced length (inch)\nC_b: lateral torsional buckling modification factor (default = 1)\n\nReturns\n\nM_n: moment capacity of the section.\n\nReference\n\nAISC Section F5\n\n\n\n\n\n","category":"function"},{"location":"#AISCSteel.flexure_capacity_f5_1-Tuple{Any}","page":"Home","title":"AISCSteel.flexure_capacity_f5_1","text":"flexure_capacity_f5_1(M_p)\n\nCalculates the moment capacity of the applicable section for compression flange yielding.\n\nDescription of applicable member: I-shaped members with slender webs bent about their major axis.\n\nArguments\n\nM_p: plastic moment of the section (kip-ft)\n\nReturns\n\nM_nCFY: moment capacity of the section for compression flange yielding.\n\nReference\n\nAISC Section F5.1\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f5_2-Tuple{Any, Any, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f5_2","text":"flexure_capacity_f5_2(R_pg, F_crLTB, S_xc)\n\nCalculates the moment capacity of the applicable section for lateral torsional buckling.\n\nDescription of applicable member: I-shaped members with slender webs bent about their major axis.\n\nArguments\n\nR_pg: bending strength reduction factor\nF_crLTB: critical stress relating to lateral torsional buckling\nS_xc: elastic section modulous referred to compression flange (inch^3)\n\nReturns\n\nM_nLTB: moment capacity of the section for lateral torsional buckling.\n\nReference\n\nAISC Section F5.2\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f5_3-Tuple{Any, Any, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f5_3","text":"flexure_capacity_f5_3(R_pg, F_crCFLB, S_xc)\n\nCalculates the moment capacity of the applicable section for compression flange lateral buckling.\n\nDescription of applicable member: I-shaped members with slender webs bent about their major axis.\n\nArguments\n\nR_pg: bending strength reduction factor\nF_crCFLB: critical stress relating to compression flange lateral buckling\nS_xc: elastic section modulous referred to compression flange (inch^3)\n\nReturns\n\nM_nCFLB: moment capacity of the section for compression flange lateral buckling.\n\nReference\n\nAISC Section F5.3\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.flexure_capacity_f5_4-Tuple{Any, Any}","page":"Home","title":"AISCSteel.flexure_capacity_f5_4","text":"flexure_capacity_f5_4(F_y, S_xt)\n\nCalculates the moment capacity of the applicable section for tension flange yielding.\n\nDescription of applicable member: I-shaped members with slender webs bent about their major axis.\n\nArguments\n\nF_y: yield strength of steel (ksi)\nS_xt: elastic section modulous referred to tension flange (inch^3)\n\nReturns\n\nM_nTFY: moment capacity of the section for tension flange yielding.\n\nReference\n\nAISC Section F5.4\n\n\n\n\n\n","category":"method"},{"location":"#AISCSteel.import_data-Tuple{Any, Symbol, String}","page":"Home","title":"AISCSteel.import_data","text":"import_data(lookup_value, lookup_col_name::Symbol, data_location::String)\n\nSearches the specified data location and filters for the first row of data found where the value in the column specified is equal to the lookup value.\n\nParameters\n\nlookup_value - The value to search for\nlookup_col_name::Symbol - the column name to search in\ncsv_file_path::String - The name of csv file in the data directory\n\n\n\n\n\n","category":"method"}]
